const axios = require('axios')

export const getDatas = async () => {
  let bla
  await axios.get('https://simple-blog-api.crew.red/posts')
    .then(function (response: any) {
      bla = response.data
    })
    .catch(function (error: any) {
      console.log(error)
    })

  return bla.then((responce) => responce)
}
